TransAlta Wyoming Wind LLC
Market-Based Rate Tariff

1.	Availability.  TransAlta Wyoming Wind LLC ("Seller") makes available under this Market-Based Rate Tariff, Volume No. 1 (the "Tariff"): 
a)	Electric energy and capacity available under this Rate Schedule to any purchaser for resale.
b)	PJM:  Seller offers regulation and frequency response service, energy imbalance service, and operating reserve service (which includes spinning, 10-minute, and 30-minute reserves) for sale into the market administered by the PJM Interconnection, L.L.C. ("PJM") and, where the PJM Open Access Transmission Tariff permits, the self-supply of these services to purchasers for a bilateral sale that is used to satisfy the ancillary services requirements of the PJM Office of Interconnection;
c)	New York:  Seller offers regulation and frequency response service, and operating reserve service (which includes 10-minute non-synchronous, 30-minute operating reserves, 10-minute spinning reserves, and 10-minute non-spinning reserves) for sale to purchasers in the market administered by the New York Independent System Operator, Inc. ("NYISO");
d)	New England:  Seller offers regulation and frequency response service (automatic generator control), operating reserve service (which includes 10-minute spinning reserve, 10-minute non-spinning reserve, and 30-minute operating reserve service) to purchasers within the markets administered by the ISO New England, Inc. ("ISO-NE");
e)	California:  Seller offers regulation service, spinning reserve service, and non-spinning reserve service to the California Independent System Operator Corporation ("CAISO") and to others that are self-supplying ancillary services to the CAISO;
f)	MISO:  Seller offers regulation service and operating reserve service (which include 10-minute spinning reserve and 10-minute supplemental reserve) for sale to the Midcontinent Independent System Operator, Inc. ("MISO") and to others that are self-supplying ancillary services to MISO;
g)	Southwest Power Pool:  Seller offers regulation service and operating reserve service (which include 10-minute spinning reserve and 10-minute supplemental reserve) for sale to the Southwest Power Pool, Inc. ("SPP") and to others that are self-supplying ancillary services to SPP;
h)	Third-party ancillary services:  Seller offers Regulation and Frequency Response Service, Reactive Supply and Voltage Control Service, Energy and Generator Imbalance Service, Operating Reserve-Spinning, and Operating Reserve-Supplemental.  Sales will not include the following: (1) sales to an RTO or an ISO, i.e., where that entity has no ability to self-supply ancillary services but instead depends on third parties; and (2) sales to a traditional, franchised public utility affiliated with the third-party supplier, or sales where the underlying transmission service is on the system of the public utility affiliated with the third-party supplier.  Sales of Operating Reserve-Spinning and Operating Reserve-Supplemental will not include sales to a public utility that is purchasing ancillary services to satisfy its own open access transmission tariff requirements to offer ancillary services to its own customers, except where the Commission has granted authorization.  Sales of Regulation and Frequency Response Service and Reactive Supply and Voltage Control Service will not include sales to a public utility that is purchasing ancillary services to satisfy its own open access transmission tariff requirements to offer ancillary services to its own customers, except at rates not to exceed the buying public utility transmission provider's OATT rate for the same service or where the Commission has granted authorization
2.	Applicability.  This Tariff is applicable to the following sales by Seller, to the extent such sales are subject to the jurisdiction of the Commission and not made pursuant to another tariff or rate schedule on file with the Commission:  (a) all wholesale sales of electric energy and capacity; and (b) all sales into the ancillary service markets described in Section 1 above.  
3.	Rates.  All sales made under this Tariff shall be made at the rates established between the purchaser and Seller.
4.	Duration.  This Tariff shall continue in effect until terminated or changed and such termination or change becomes effective in accordance with any applicable regulatory requirements.
5.	Modifications.  Seller may unilaterally apply, under Federal Power Act Section 205 and the regulations promulgated thereunder, to the Commission or other regulatory agency having jurisdiction for a modification of this Tariff.
6.	Other Terms and Conditions.  All other terms and conditions shall be established by agreement between the purchaser and Seller.
7.	Compliance with Commission Regulations.  Seller shall comply with the provisions of 18 C.F.R. Part 35, Subpart H, as applicable, and with any conditions the Commission imposes in its orders concerning Seller's market-based rate authority, including orders in which the Commission authorizes Seller to engage in affiliate sales under this tariff or otherwise restricts or limits the Seller's market-based rate authority.  Failure to comply with the applicable provisions of 18 C.F.R. Part 35, Subpart H and with any orders of the Commission concerning Seller's market-based rate authority, will constitute a violation of this Tariff.
8.	Limitations and Exemptions Regarding Market-Based Rate Authority.  Seller has been granted waiver of Subparts B and C of Part 35 of the Commission's regulations requiring the filing of cost-of-service information, except as to sections 35.12(a), 35.13(b), 35.15, and 35.16; granted waiver of Parts 41, 101 and 141, except as to sections 141.14 and 141.15, of the Commission's accounting and periodic reporting regulations; and granted blanket authorization for all future issuances of securities or assumptions of liabilities pursuant to Section 204 of the Federal Power Act, 16 U.S.C.  824e, and Part 34 of the Commission's regulations.  See FPL Energy Wyoming, LLC, Docket No. ER03-1025-000.
9.	Seller Category.  Seller is a Category 1 seller, as defined in 18 C.F.R. 35.36(a), in the following regions:  Central, Northeast, Southeast, Southwest, and Southwest Power Pool.  Seller is a Category 2 seller, as defined in 18 C.F.R. 35.36(a), in the Northwest region.

10.	Effective Date.  This Tariff shall be effective on the date established by the Commission.
